// Ambil data dari input
const risingQueries = $('Save Related Query').first().json.related_queries.rising;
// Generate angka acak antara 0 dan 9
const randomIndex = Math.floor(Math.random() * risingQueries.length);

// Ambil query berdasarkan index
const randomQuery = risingQueries[randomIndex].query;

return {
  json: {
    randomQuery,
    index: randomIndex,
  }
};

const default_query = "Teknologi"
const request = $input?.first()?.json?.message?.text || "";

const match = request.match(/#q\s+([^\n:]+)/i);

const topic = match ? match[1].trim() : default_query;

return {
  json: {
    detectedTopic: topic,
  }
};

// Initialize content and metadata
const date = new Date().toISOString().split('T')[0];
const contentRaw = $('Open Router Chat').first().json.choices[0].message.content;
const category = $('Select Topic').first().json.detectedTopic;
const excerpt = $('Create Comprehensive Prompt').first().json.topic;
const dateNow = date;
let content = '';

if (typeof contentRaw === 'string') {
  // Cek apakah mengandung "\n" (escaped)
  if (contentRaw.includes('\\n')) {
    content = contentRaw.replace(/\\n/g, '\n').trim();
  } else {
    content = contentRaw.trim();
  }
}

const slug = excerpt
  .toLowerCase()
  .replace(/[^a-z0-9\s-]/g, '')       // Remove special characters
  .replace(/\s+/g, '-')               // Replace spaces with hyphens
  .replace(/-+/g, '-')                // Collapse multiple hyphens
  .replace(/^-|-$/g, '');             // Trim leading/trailing hyphens

const title = $('parsed json').first().json.judul;
const thumb = $input.first().json.results[0].urls.thumb
const smallimg = $input.first().json.results[0].urls.small

const imageBlock = `<p align="center">
  <img src="${smallimg}" alt="${slug}" />
</p>\n\n`;

// Create frontmatter block
const frontmatter = `---
title: "${title}"
date: "${dateNow}"
category: "${category}"
excerpt: "${excerpt}"
image: "${thumb}"
---
`;

// Combine with content
const fullMarkdown = frontmatter + '\n' + imageBlock + content;

// Generate filename
const filename = `${dateNow}-${slug}.md`;

// Return result
return {
  topic: excerpt,
  filename: filename,
  content: fullMarkdown,
};

